window.bookSummaryJSON = "<p><b>Bestselling author of the Savage Falls Sinners MC series, Caitlyn Dare, brings you a new, dark enemies-to-lovers crossover novella. </b></p> <p>My name is Quinn Renshaw, and my father is the VP of the Savage Falls Sinners MC. </p> <p>But I refuse to be a club princess. I want more from life. I want to graduate and go to college and spread my wings. I want a life beyond Savage Falls and club life. Until him. </p> <p>Killian Crankton, VP of the Red Ridge Reapers. He looks at me and I feel things. Things I don’t want to feel. Dangerous, deadly things. Things that will end up with my heart in tatters. </p> <p>Because I’m about to find out that Crank will do anything to get wants he wants. Especially me. </p> <p><b><i>Crank</i></b><b> is an age gap, opposites attract crossover story set in the Sinners MC world, but it can be listened to as a standalone. If possessive, tattooed, motorcycle-riding alphaholes aren't your thing, you probably won't like this book!</b></p>"; 
